/* ====== Gruvbox Dark theme for Sidebery ======
   Palette:
   bg0:   #282828
   bg1:   #3c3836
   bg2:   #504945
   fg:    #ebdbb2
   muted: #a89984
   yellow:#d79921
   green: #b8bb26
   blue:  #83a598
   orange:#fe8019
   red:   #fb4934
   ============================================ */

#root.root {
  /* layout variables (kept from your original) */
  --tabs-indent: 0px;
  --general-border-radius: 6px;
  --tabs-height: 32px;
  --tabs-margin: 6px;
  --pinned-tabs-col: 4;

  /* gruvbox variables */
  --gb-bg0: #282828;
  --gb-bg1: #3c3836;
  --gb-bg2: #504945;
  --gb-fg:  #ebdbb2;
  --gb-muted: #a89984;
  --gb-yellow: #d79921;
  --gb-green:  #b8bb26;
  --gb-blue:   #83a598;
  --gb-orange: #fe8019;
  --gb-red:    #fb4934;

  /* Sidebery/Firefox mapped colors */
  --toolbar-bg: var(--gb-bg0);
  --frame-bg:   var(--gb-bg0);

  /* tab colors used by Sidebery internals */
  --tabs-activated-bg: var(--gb-bg1);
  --tabs-activated-fg: var(--gb-fg);
  --tabs-normal-bg:    var(--gb-bg0);
  --tabs-normal-fg:    var(--gb-fg);
  --tabs-hover-bg:     var(--gb-bg1);
  --tabs-muted-fg:     var(--gb-muted);

  flex-direction: column;
}

/* ----- Navigation bar ----- */
.NavigationBar {
  transition: all 200ms ease-in-out;
  background: var(--gb-bg0);
  color: var(--gb-fg);
  border-bottom: 1px solid var(--gb-bg1);
}

.NavigationBar .main-items {
  justify-content: center;
}

.NavigationBar[data-layout="inline"] .main-items .nav-item {
  transform: translateX(0) !important;
  position: relative !important;
  flex-grow: 1;
  max-width: 66px;
  color: var(--gb-fg);
}

.NavigationBar[data-layout="inline"] .main-items .nav-item[data-active="false"] {
  display: none;
}

/* bottom bar hidden on small widths */
.BottomBar { display: none; }

/* ----- Tabs ----- */
.Tab {
  min-width: 33px;
  transition: all 200ms ease-in-out;
  color: var(--tabs-normal-fg);
}

.Tab .audio, .Tab .title {
  opacity: 0 !important;
  transition: opacity 250ms ease-in-out;
  color: var(--tabs-normal-fg);
}

/* Favicon sizes */
.Tab[data-pin="true"] .fav, .Tab[data-pin="true"] .fav-icon {
  width: 20px; height: 20px;
}
.Tab[data-pin="false"] .fav, .Tab[data-pin="false"] .fav-icon {
  width: 18px; height: 18px;
}

/* Active pinned tab highlight */
.Tab[data-pin="true"][data-active="true"] .color-layer {
  background-color: var(--gb-bg1) !important;
  border-radius: var(--general-border-radius);
}

/* Non-pinned tabs: flat unless active/hover */
.Tab[data-pin="false"] .color-layer {
  opacity: 0 !important;
  border: 0 !important;
  background: transparent !important;
}

/* Active non-pinned tab: subtle lift + accent border */
.Tab[data-pin="false"][data-active="true"] .body {
  background: var(--gb-bg1);
  box-shadow: 0 0 16px rgba(0,0,0,0.25);
  border-left: 2px solid var(--gb-yellow);
  border-radius: var(--general-border-radius);
}

/* Hover state for tabs */
.Tab:hover .body {
  background: var(--tabs-hover-bg);
}

/* Remove default borders */
.Tab[data-pin="false"] { border: 0 !important; }

/* Title gradient fade */
.Tab .title {
  background: linear-gradient(90deg, var(--tabs-normal-fg) 80%, #0000 99%);
  -webkit-background-clip: text;
  background-clip: text;
  color: transparent;
}

/* Fav icon ring when playing audio (gruvbox blue) */
.Tab .audio[data-active="true"] .fav,
.Tab .audio[data-active="true"] .fav-icon {
  outline: 2px solid var(--gb-blue);
  outline-offset: 2px;
  border-radius: 6px;
}

/* ----- Responsive tweaks ----- */
@media screen and (min-width: 350px) {
  .NavigationBar[data-layout="inline"] .main-items .nav-item[data-active="false"] {
    display: flex;
  }
  .BottomBar { display: flex; }

  #root.root { --tabs-indent: 14px; }
  .Tab .audio, .Tab .title { opacity: 1 !important; }

  #root.root { --tabs-pinned-height: 40px; }
  #root.root {
    --tabs-pinned-width: calc(
      (100vw - (var(--tabs-margin) * (var(--pinned-tabs-col) + 1)))
      / var(--pinned-tabs-col)
    );
  }
}

/* ----- Optional: tidy sidebar header if visible ----- */
#sidebar-header {
  background: var(--gb-bg0);
  color: var(--gb-muted);
  border-bottom: 1px solid var(--gb-bg1);
}
